import React from "react";

function Form({ setUrl, url }) {

    function handleSubmit(event) {
        console.log(event);
        event.preventDefault();
                console.log(event);

        setUrl(event.target[0].url);
    }

    return (
        <><form className="text-base h-8" onSubmit={handleSubmit}>
            <label className="text-lg h-8">
                Url:
                <input
                    type="text"
                    name="url"
                    className="h-5 border-2 mx-2 border-black h-8 w-3/6 rounded-lg"
                />
            </label>
            <input type="submit" className="bg-slate-300 p-1 rounded-lg" />
        </form >
            {url}
            </>
    );
}

export default Form
